import React from "react";
import Todo from "./Todo.js";
class TodoList extends React.Component {
	render({ todos }) {
		console.log(todos);
		return (
			<>
				<Todo />
				<Todo />
				<Todo />
				<Todo />
				<Todo />
				<Todo />
			</>
		);
	}
}

export default TodoList;
